import React from 'react';
import './App.css';
import { Layout, Menu } from 'antd';
import { MenuItem } from 'rc-menu';

const { Sider } = Layout;

function sider(){
    return(
       <Sider style={{background:"red"}}>Sider
       <Menu>
           <Menu.item>
               Dashboard
           </Menu.item>
           <subMenu>
               <Menu.ItemGroup title="About Us">
               <MenuItem key="location1"> Location 1</MenuItem>
               <MenuItem key="location2"> Location 2</MenuItem>
               <MenuItem key="location3"> Location 3</MenuItem>
               </Menu.ItemGroup>
           </subMenu>
       </Menu>
       </Sider>
    );
}
export default sider;
